svg.script:
const $t = document.querySelector('.tveye');

const observer = new IntersectionObserver(
  (entries) => {
    entries.forEach((entry) => {
      if (entry.isIntersecting) {
        entry.target.classList.add('active');
        observer.unobserve(entry.target);
      }
    })
  },
  {
    threshold: 0.1,
  }
)

observer.observe($t)
